import React, { Component } from 'react'
import '../css/navbar.css'

export default class Navbar extends Component {
    constructor(props) {
        super(props)
        this.state = {
            active: "sorting"
        }
    }

    render() {
        return ( 
        <div className="navbar">
            <div className="nav-item" id="sorting"><a className={`${this.state.active==="path-finding" ? "active" : ""}`} href="">Sorting</a></div>
            <div className="nav-item" id="graphs"><a className={`${this.state.active==="path-finding" ? "active" : ""}`} href="">Graphs</a></div>
            <div className="nav-item" id="path-finding"><a className={`${this.state.active==="path-finding" ? "active" : ""}`} href="">Path Finding</a></div>
        </div>
        )
    }
}
